-- -----------------------------------------------------
-- База данных fantasy
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Википедия
-- Фэнтези-футбол — игра, в которой участники формируют виртуальную команду футболистов, чьи прототипы принимают участие 
-- в реальных соревнованиях и, в зависимости от актуальной статистики своих выступлений, набирают зачетные баллы. 
-- -----------------------------------------------------
DROP DATABASE IF EXISTS `fantasy`;
CREATE DATABASE IF NOT EXISTS `fantasy`;
USE `fantasy`;

-- -----------------------------------------------------
-- Таблица `fantasy`.`users` Содержит данные пользователей - участников игры
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`users`;
CREATE TABLE IF NOT EXISTS `fantasy`.`users` (
  `id` SERIAL PRIMARY KEY,
  `user` VARCHAR(45) NOT NULL COMMENT 'Пользователи');

-- -----------------------------------------------------
-- Таблица `fantasy`.`leagues` Футбольные национальные чемпионаты на основе каждого из которых организуются фэнтези-турниры. 
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`leagues`;
CREATE TABLE IF NOT EXISTS `fantasy`.`leagues` (
  `id` SERIAL PRIMARY KEY,
  `league` VARCHAR(45) NOT NULL COMMENT 'Футбольные национальные чемпионаты');
 
 -- -----------------------------------------------------
-- Таблица `fantasy`.`user_teams` Названия команд пользователей, участвующих в фэнтези-турнирах. 
-- В каждом из турниров пользователь может иметь только одну команду.
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`user_teams`;
CREATE TABLE IF NOT EXISTS `fantasy`.`user_teams` (
  `user_id` BIGINT UNSIGNED NOT NULL,
  `league_id` BIGINT UNSIGNED NOT NULL,
  `name` VARCHAR(255) NOT NULL COMMENT 'Названия команд пользователей',
  PRIMARY KEY (`league_id`, `user_id`),
    FOREIGN KEY (`user_id`)
    REFERENCES `fantasy`.`users` (`id`),
    FOREIGN KEY (`league_id`)
    REFERENCES `fantasy`.`leagues` (`id`));

-- -----------------------------------------------------
-- Таблица `fantasy`.`clubs` Реальные футбольные клубы - участники национальных чемпионатов. 
-- В составе команды пользователя не может быть более 2 игроков из одного клуба.
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`clubs`;
CREATE TABLE IF NOT EXISTS `fantasy`.`clubs` (
  `id` SERIAL PRIMARY KEY,
  `league_id` BIGINT UNSIGNED NOT NULL,
  `club` VARCHAR(45) NOT NULL COMMENT 'Футбольные клубы - участники национальных чемпионатов',
    FOREIGN KEY (`league_id`)
    REFERENCES `fantasy`.`leagues` (`id`));

-- -----------------------------------------------------
-- Таблица `fantasy`.`positions` Позиции игроков на поле. Команда пользователя должна состоять из 2 вратарей, 5 защитников,
-- 5 полузащитников и 3 нападающих.
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`positions`;
CREATE TABLE IF NOT EXISTS `fantasy`.`positions` (
  `id` SERIAL PRIMARY KEY,
  `short_name` CHAR(1) NOT NULL COMMENT 'Сокращенное наименование позиции',
  `position` VARCHAR(45) NOT NULL COMMENT 'Полное наименование позиции');

-- -----------------------------------------------------
-- Таблица `fantasy`.`players` Реальные футболисты, каждый из которых имеет стоимость в условных единицах.
-- Суммарная стоимость игроков команды пользователя не может превышать 100 у.е. 
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`players`;
CREATE TABLE IF NOT EXISTS `fantasy`.`players` (
  `id` SERIAL PRIMARY KEY,
  `position_id` BIGINT UNSIGNED NOT NULL,
  `player` VARCHAR(45) NOT NULL COMMENT 'Фамилия футболиста',
  `price` FLOAT NOT NULL COMMENT 'Стоимость футболиста',
  `club_id` BIGINT UNSIGNED NOT NULL,
    FOREIGN KEY (`position_id`)
    REFERENCES `fantasy`.`positions` (`id`),
    FOREIGN KEY (`club_id`)
    REFERENCES `fantasy`.`clubs` (`id`));
   
-- -----------------------------------------------------
-- Таблица `fantasy`.`scores` По результатам реальных футбольных матчей футболисты в зависимости от статистики своих выступлений, 
-- набирают зачетные очки (за участие в матче, голы, голевые передачи и т.д.). 
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`scores`;
CREATE TABLE IF NOT EXISTS `fantasy`.`scores` (
  `id` SERIAL PRIMARY KEY,
  `league_id` BIGINT UNSIGNED NOT NULL,
  `tour_id` INT UNSIGNED NOT NULL COMMENT 'Номер тура чемпионата',
  `player_id` BIGINT UNSIGNED NOT NULL,
  `score` INT NULL DEFAULT NULL COMMENT 'Количество очков, набранных футболистом в туре',
    FOREIGN KEY (`league_id`)
    REFERENCES `fantasy`.`leagues` (`id`),
    FOREIGN KEY (`player_id`)
    REFERENCES `fantasy`.`players` (`id`));
   
-- -----------------------------------------------------
-- Таблица `fantasy`.`team_on_tour` Содержит данные о футболистах, включенных в состав команды пользователя. 
-- На каждый тур фэнтези-турнира, соответствующего туру реального чемпионата, пользователь заявляет состав своей команды,
-- в который входят 11 из 15 футболистов (1 вратарь, не менее 3 защитников, не менее 2 полузащитников и не менее 1 нападающего).
-- Также до начала каждого тура пользователь может совершить трансфер - продать любого футболиста своей команды по номинальной стоимости
-- и заменить его другим футболистом соответствующей позиции (не более 3 трансферов за тур).
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`team_on_tour`;
CREATE TABLE IF NOT EXISTS `fantasy`.`team_on_tour` (
  `id` SERIAL PRIMARY KEY,
  `user_team_id` BIGINT UNSIGNED NOT NULL,
  `league_id` BIGINT UNSIGNED NOT NULL,
  `tour_id` INT UNSIGNED NOT NULL,
  `player_id` BIGINT UNSIGNED NOT NULL,
  `status` ENUM('on_field', 'sub') NOT NULL COMMENT 'Статус игрока - в поле или в запасе',
    FOREIGN KEY (`league_id` , `user_team_id`)
    REFERENCES `fantasy`.`user_teams` (`league_id` , `user_id`),
    FOREIGN KEY (`player_id`)
    REFERENCES `fantasy`.`players` (`id`));

-- -----------------------------------------------------
-- Таблица `fantasy`.`schedule` Содержит расписание игр туров чемпионатов с указанием дэдлайна - времени до которого возможно изменение
-- состава команды.
-- -----------------------------------------------------
DROP TABLE IF EXISTS `fantasy`.`schedule`;
CREATE TABLE IF NOT EXISTS `fantasy`.`schedule` (
  `league_id` BIGINT UNSIGNED NOT NULL,
  `tour_id` INT UNSIGNED NOT NULL,
  `deadline` DATETIME NOT NULL,
  `home_club_id` BIGINT UNSIGNED NOT NULL,
  `guest_club_id` BIGINT UNSIGNED NOT NULL,
    FOREIGN KEY (`league_id`)
    REFERENCES `fantasy`.`leagues` (`id`),
    FOREIGN KEY (`home_club_id`)
    REFERENCES `fantasy`.`clubs` (`id`),
    FOREIGN KEY (`guest_club_id`)
    REFERENCES `fantasy`.`clubs` (`id`));

