-- -----------------------------------------------------
-- СКРИПТЫ
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Характерные выборки
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Количество команд пользователей в чемпионате России
-- -----------------------------------------------------
select count(name) as 'Премьер-лига Россия. Количество участников' from  user_teams where league_id = 2;

-- -----------------------------------------------------
-- Футбольные клубы - участники чемпионата Англии
-- -----------------------------------------------------
select club as 'Премьер-лига Англия' from clubs where league_id = 1;

-- -----------------------------------------------------
-- Группировки
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Количество очков, набранных футболистами чемпионата Англии
-- -----------------------------------------------------
select 
	(select player from players p2 where p2.id = scores.player_id )	as 'Игрок',
	sum(score) as 'Очки'
from scores where league_id = 1 group by player_id order by sum(score) desc;

-- -----------------------------------------------------
-- Команда пользователя - лидер турнира "Чемпионат Англии" по итогам прошедших туров
-- -----------------------------------------------------
select u2.`user` as 'Создал', ut2.name as 'Команда', sum(s.score) as 'Очки' 
from team_on_tour tot , scores s , user_teams ut2, users u2 
where tot.league_id = 1 and tot.status like 'on_field' and tot.user_team_id = ut2.user_id 
	and s.league_id = 1 and s.player_id = tot.player_id and s.tour_id = tot.tour_id 
	and ut2.league_id = 1 and ut2.user_id = u2.id 
group by ut2.name order by sum(s.score) desc limit 1;

-- -----------------------------------------------------
-- JOIN'ы
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Результаты команды пользователя id=1 в первом туре чемпионата России
-- -----------------------------------------------------
select p2.short_name as 'Позиция', p.player as 'Игрок', s.score as 'Очки'
from team_on_tour tot , scores s , players p , positions p2
where tot.league_id = 2 and tot.player_id = p.id and tot.status like 'on_field' and tot.tour_id = 1 and tot.user_team_id = 1
	and s.league_id = 2 and s.player_id = tot.player_id and s.tour_id = 1
	and p.position_id = p2.id;

-- -----------------------------------------------------
-- Результаты команд пользователей в чемпионате России по итогам прошедших туров
-- -----------------------------------------------------
select ut2.name as 'Команда', sum(s.score) as 'Очки' from team_on_tour tot join scores s join user_teams ut2
on tot.league_id = 2 and tot.status like 'on_field' and tot.user_team_id = ut2.user_id 
	and s.league_id = 2 and s.player_id = tot.player_id and s.tour_id = tot.tour_id 
	and ut2.league_id = 2 
group by ut2.name order by sum(s.score) desc;

-- -----------------------------------------------------
-- Вложенные таблицы
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Все команды пользователя id = 35
-- -----------------------------------------------------
select 
	(select league  from leagues l2 where l2.id = ut.league_id) as 'Турнир',
	name as 'Команда',
	(select user from users u2 where u2.id = ut.user_id ) as 'Создал'
from user_teams ut where user_id = 35;

-- -----------------------------------------------------
-- Количество очков набранных полузащитниками футбольного клуба 'Зенит' чемпионата России со стоимостью менее 7 у.е.
-- -----------------------------------------------------
select player as 'Игрок', 
	(select sum(score) from scores s2 where s2.player_id = p.id) as Очки,
	price as 'Цена'
from players p
where p.club_id = 21 and p.position_id = 3 and p.price < 7 order by Очки desc;

-- -----------------------------------------------------
-- Представления
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Информация о футболистах чемпионата Англии
-- -----------------------------------------------------
drop view if exists all_players_England;
create or replace view all_players_England (id, player, `position`, club, price)
as 
select id, player,
	(select `position` from positions p2 where p2.id = p.position_id ),
	(select club from clubs c where c.id = p.club_id and c.league_id = 1),
	price
from players p order by club_id, position_id, price desc;

select * from all_players_England;
-- -----------------------------------------------------
-- Очки, набранные футболистами чемпионата Англии в 1 туре
-- -----------------------------------------------------
drop view if exists players_England_on_tour1;
create or replace view players_England_on_tour1 (id, player, `position`, club, price, score)
as 
select id, player,
	(select `position` from positions p2 where p2.id = p.position_id ),
	(select club from clubs c2 where c2.id = p.club_id),
	price, 
	(select score from scores s2 where s2.player_id = p.id and league_id = 1 and tour_id = 1) as score
from players p order by score desc, price;

select * from players_England_on_tour1;
 
-- -----------------------------------------------------
-- Хранимые процедуры
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Подсчет очков, набранных командой пользователя в туре
-- -----------------------------------------------------
drop procedure if exists tour_scores;

delimiter //
create procedure tour_scores(id_league int, id_user int, id_tour int)
begin
	select sum(score) 
	from team_on_tour tot , scores s
	where tot.league_id = id_league and tot.status like 'on_field' and tot.tour_id = id_tour and tot.user_team_id = id_user
		and s.league_id = id_league and s.player_id = tot.player_id and s.tour_id = id_tour;
end//
delimiter ;

call tour_scores(2, 1, 1);

-- -----------------------------------------------------
-- Подсчет очков, набранных командой пользователя c начала турнира
-- -----------------------------------------------------
drop procedure if exists total_scores;

delimiter //
create procedure total_scores(id_league int, id_user int)
begin
	select sum(score) 
	from team_on_tour tot join scores s
	on tot.league_id = id_league and tot.status like 'on_field' and tot.user_team_id = id_user
		and s.league_id = id_league and s.player_id = tot.player_id and s.tour_id = tot.tour_id ;
end//
delimiter ;

call total_scores(2, 1);

-- -----------------------------------------------------
-- Триггеры
-- -----------------------------------------------------
-- -----------------------------------------------------
-- Устанавливаем требование к стоимости игроков, цена должна быть в пределах от 4 до 10 у.е
-- -----------------------------------------------------
drop trigger if exists wrong_price_insert;

delimiter //
create trigger wrong_price_insert before insert on players
for each row 
begin
	if new.price < 4 or new.price > 10 
	then signal sqlstate '45000' set MESSAGE_TEXT = 'Установите стоимость в пределах от 4 до 10 у.е.';
  end if;
end//
delimiter ;

drop trigger if exists wrong_price_update;

delimiter //
create trigger wrong_price_update before insert on players
for each row 
begin
	if new.price < 4 or new.price > 10 
	then signal sqlstate '45000' set MESSAGE_TEXT = 'Установите стоимость в пределах от 4 до 10 у.е.';
  end if;
end//
delimiter ;










